        "#863 Extended Bodies:Multiple Parallel Players, Multiple Extended Object",
        ["title Extended Bodies:Multiple Parallel Players, Multiple Extended Object\nauthor Anonymous\nhomepage www.puzzlescript.net\n\nverbose_logging\n\n========\nOBJECTS\n========\n\nBackground \nwhite \n\nTarget \nDarkBlue \n\nWall \nDarkGrey\n\nPlayer\nBlue\n..0..\n..0.0\n00000\n.000.\n.0.0.\n\nShadow\nBlack\n..0..\n0.0..\n00000\n.000.\n.0.0.\n\n( three multi-cells blocks )\nCrate \norange\n\nChest\ngreen\n\nBox\nred\n\n( 1-cell small block )\nSmall\ndarkred\n.....\n.000.\n.000.\n.000.\n.....\n\n( sticky, multicellular block when in contact )\nGlue\npink\n.000.\n00000\n00000\n00000\n.000.\n\n( a flag to know what is allowed move )\nWanna_Move\n#ff00ff\n.....\n.....\n..0..\n.....\n.....\n\n=======\nLEGEND\n=======\n\n( all things that can move and push blocks )\nMover = Player or Player \n\n. = Background\n# = Wall\nP = Player\nS = Shadow\n* = Crate\n+ = Box\n% = Chest\no = Small\ng = Glue\n\n( blocks that can be moved by the player )\nMovable = Crate or Box or Chest or Small or Glue\n\n\n( things that can stop a movement if they are stationary )\nObstacle = Wall or Mover\n\n=======\nSOUNDS\n=======\n\n================\nCOLLISIONLAYERS\n================\n\nBackground\nTarget\nObstacle\nWanna_Move\nMovable\nShadow\n\n======\nRULES \n====== \n\n[ > player ] [ stationary shadow ] -> [ > player ] [ < shadow ]\n\n( 1. Propagate movements forward )\n[ > Mover | Movable ] -> [ > Mover | > Movable ]\n+ [ > Box ] [ Box ] -> [ > Box ] [ > Box ]\n+ [ > Crate ] [ Crate ] -> [ > Crate ] [ > Crate ]\n+ [ > Chest ] [ Chest ] -> [ > Chest ] [ > Chest ]\n+ [ moving Glue | Glue ] -> [ moving Glue | moving Glue ]\n\n( 2. Propagate obstructions backwards )\n[ > Mover | stationary Obstacle ] -> [ stationary Mover | Obstacle ]\n+ [ > Crate ] [ stationary Crate ] -> [ stationary Crate ] [ Crate ]\n+ [ > Box ] [ stationary Box ] -> [ stationary Box ] [ Box ]\n+ [ > Chest ] [ stationary Chest ] -> [ stationary Chest ] [ Chest ]\n+ [ moving Glue | stationary Glue ] -> [ stationary Glue | Glue ]\n\n( 3. remove all movement, keep a flag )\n[ > Movable ] -> [ Movable wanna_move ]\n\n( 4. propagate movement only on wanna_move things )\n( ie redo step 1 but with WANNA_MOVE added to the first line below )\n[ > Mover | Movable WANNA_MOVE ] -> [ > Mover | > Movable ]\n+ [ > Box ] [ Box ] -> [ > Box ] [ > Box ]\n+ [ > Crate ] [ Crate ] -> [ > Crate ] [ > Crate ]\n+ [ > Chest ] [ Chest ] -> [ > Chest ] [ > Chest ]\n+ [ moving Glue | Glue ] -> [ moving Glue | moving Glue ]\n\n( 5. cleanup, remove flag )\n[ wanna_move ] -> [ ]\n\n==============\nWINCONDITIONS\n==============\n\n======= \nLEVELS\n=======\n\n###################\n#.................#\n#.................#\n#...*..g.g.#......#\n#...*......#...g###\n#...*...o.%%%.....#\n#...+++.o.%.......#\n#....+....%%%.....#\n#....+.....P...g..#\n#....p.gg.........#\n###################\n\n",["line 78 : You're repeating the object PLAYER here multiple times on the RHS. This makes no sense. Don't do that."],0]
